import React, { Component } from "react";
import Node from "./node/node";

class Grid extends Component {
  state = {
    nodes: [],
  };

  render() {
    const { nodes } = this.state;
    console.log(nodes);
    return (
      <div className="grid">
        {nodes.map((rowIndex) => {
          return (
            <div key={rowIndex}>
              {rowIndex.map(() => {
                return <Node></Node>;
              })}
            </div>
          );
        })}
      </div>
    );
  }

  componentDidMount() {
    let nodes = [];
    for (let i = 0; i < 15; i++) {
      let currentRow = [];
      for (let j = 0; j < 25; j++) {
        currentRow.push([]);
      }
      nodes.push(currentRow);
    }
    this.setState({ nodes });
  }
}

export default Grid;
